import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  const navigate = useNavigate();

  const handleGoogleLogin = async () => {
    try {
      // Save the current location before redirecting to Google authentication

      // Redirect to Google authentication endpoint on your backend
      window.location.href = 'http://localhost:5000/google'; // Replace with your actual endpoint

      // Save the current location to sessionStorage or localStorage
    } catch (error) {
      console.error('Error logging in with Google:', error);
    }
  };



  return (
    <div>
      <h1>Welcome</h1>
      <button onClick={handleGoogleLogin}>Login with Google</button>
    </div>
  );
};

export default Dashboard;
